  \"2016-05-25T00:27:49.983944\",\n\t\"name\": \"national-automotive-sampling-system-crashworthiness-data-system-nass-cds-nass-cds-multiyea\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Automotive Sampling System
  (NASS) Crashworthiness Data System (CDS) is a nationwide crash data collection program
  sponsored by the U.S. Department of Transportation.  It is operated by the National
  Center for Statistics and Analysis (NCSA) of the National Highway Traffic Safety
  Administration (NHTSA).  The NASS CDS provides an automated, comprehensive national
  traffic crash database, and collects detailed information on a sample of all police-reported
  light ]motor vehicle traffic crashes.  Data collection is accomplished at 24 geographic
  sites, called Primary Sampling Units (PSUs).  These data are weighted to represent
  all police reported motor vehicle crashes occurring in the USA during the year involving
  passenger cars, light trucks and vans that were towed due to damage.\",\n\t\"license_title\":
